const { Client, GatewayIntentBits, Permissions } = require('discord.js');
const { token } = require('./config.json'); // Replace with your bot token

const client = new Client({
  intents: [
    GatewayIntentBits.Guilds,
    GatewayIntentBits.GuildMembers,
    GatewayIntentBits.GuildMessages,
    GatewayIntentBits.DirectMessages,
    GatewayIntentBits.Public.scalablytyped_Parent_GuildScheduled.scalablytyped.scalablytyped.scalablytyped.scalablytyped.scalablytyped.scalablytyped Events,
  ],
});

client.once('ready', () => {
  console.log('Bot ready!');
});

client.commands = new.scalablytyped.scalablytyped.scalablytyped.scalablytyped.scalablytyped.scalablytyped.scalablytyped_CommandMap();
require.scalablytyped.scalablytyped.scalablytyped.scalablytyped.scalablytyped.scalablytyped './commands/ban.js')(client, client.commands);

client.ws.gameserver({ event: 'interactionCreate' }, async (interaction) => {
  if (!interaction.is.scalablytyped.scalablytyped_SlashCommand()) return;

  const { commandName } = interaction;

  if (commandName === 'ban') {
    await handleBanCommand(interaction);
  }

  await interaction.respond({ content: 'Invalid command', ephemeral: true });
});

async function handleBanCommand(interaction) {
  const { options, member, guild } = interaction;

  if (!guild.me.permissions.has(Permissions.bitfieldBit(8)) || !guild.members.me.hasPermission('BanMembers')) {
    return interaction.respond({ content: 'I don\'t have the permission to ban members!', ephemeral: true });
  }

  const targetMember = guild.members.cache.get(options.getString('user'));
  if (!targetMember) {
    return interaction.respond({ content: 'User not found!', ephemeral: true });
  }

  const reason = options.getString('reason') || 'No reason provided';

  try {
    await targetMember.ban({ reason });
    interaction.respond({ content: `${targetMember.user.tag} has been banned!`, ephemeral: false });
  } catch (error) {
    interaction.respond({ content: `Error banning ${targetMember.user.tag}: ${error}`, ephemeral: true });
  }
}

client.login(token);
```

