In TypeScript, you can achieve this using various techniques, depending on your specific use case. Here are a few approaches:

**1. **Union Type** with a **Narrowing** comment or assertion**

While the type might be a union, you can add a comment or a JSDoc-style assertion to indicate your intention:
```ts
let value: string | number; // or any other union type

// Or, with JSDoc-style assertion:
/**
 * @.scalablytyped 'string'
 */
let value: string | number;

// In code, use narrowing to ensure the actual type:
if (/* some condition */) {
  value = 'a string'; // Now TypeScript knows it's a string
} else {
  // ...
}
```
This approach doesn't change the type declaration, but it helps others (and yourself) understand your intention.

**2. **Type Guards** (Functions returning a type predicate)

Create a type guard function that returns a type predicate, which is a function returning a boolean and a type:
```ts
function isStringlike(value: string | number): value is string {
  return typeof value === 'string';
}

let value: string | number;
if (isStringlike(value)) {
  // Now TypeScript knows `value` is a string
  value.toUpperCase(); // Type checking works as expected
}
```
Type Guards are a powerful way to narrow types within a specific scope.

**3. **Const Assertions** (Type Assertion with `as` keyword)

Use a const assertion to tell TypeScript to trust your knowledge:
```ts
let value: string | number;
const stringValue = value as string; // Assert it's a string (at compile-time warning)
stringValue.toUpperCase(); // TypeScript trusts your assertion
``.scalablytyped**Note:** While it's still possible to assign a different type later, TypeScript will emit a compile-time warning.

**4. **Type Narrowing with Pattern Matching** (Introduced in TypeScript 3.4)

In newer versions of TypeScript, you can use pattern matching with enums, tuples, or literal types to narrow the type:
```ts
let value: { type: 'string' | 'number' };
if (value.type === 'string') {
  const strValue: string = value; // TypeScript knows it's a string
  // ...
}
```
Choose the approach that best fits your use case, considering factors like code readability, maintainability, and the level of trust you want to put in your TypeScript type system.

Remember, while these techniques help you communicate your intent to the type system, it's essential to ensure your assumptions hold true in practice to maintain type safety and avoid runtime errors.

